import React from "react";
import Accordion from "./Accordion";

const Faqs = (props) => {
  const { questions } = props;
  return (
    <div className="faqs">
      <div className='f'>
        {questions.map((item) => {
          return <Accordion title={item.question} content={item.answer} />;
        })}
      </div>
      <div className='faqsimg'>
        <img
          className="faqsimage"
          href="https://imgur.com/kV37dMu.jgp"
          alt="alt"
        />
      </div>
    </div>
  );
};

export default Faqs;
